import React from 'react';
import './RecipeList.scss';

const RecipeListItem = ({ recipe }) => {

    const url = "/recipes/" + recipe.id;

    return (
        <div>
            <h3>{recipe.name}</h3>
            <Link to={url}>{recipe.name}</Link>
        </div>
    )

}

export default RecipeListItem;
